import React from 'react';
import styled from 'styled-components';
import {setFlex, elevation, demotion, colors} from '../../utilities';

const SlideTwo = ({className}) => {
  return (
    <div className={className}>
      <h3>Juegos Inflables</h3>
    </div>
  );
}

const STwo = styled(SlideTwo)`

  background-image: linear-gradient(to right, ${colors.green_blue}, #4048C9);
  ${setFlex()};
  color: white;
  width: 98%;
  height: 65vh;
  font-size: 4rem;
  margin: 1rem auto;
  border-radius: .7rem;
  ${elevation[5]}
`;

export default STwo;
